 */
contract EthereumConfig {
    constructor() {
        FHE.setCoprocessor(ZamaConfig.getEthereumConfig());
    }

    function protocolId() public pure returns (uint256) {
        return ZamaConfig.getEthereumProtocolId();
    }
}
